import styled from "styled-components";

export const LegendContainer = styled.div`
  background-color: white;
  padding: 16px;
  position: absolute;
  bottom: 10px;
  left: 10px;
  z-index: 1000;
`;

export const LegendItem = styled.div`
  display: flex;
  align-items: center;
`;

export const LegendImage = styled.img`
  width: 100%;
  height: 100%;
  object-fit: cover;
  margin-right: 8px;
`;

export const LegendTitle = styled.p`
  margin: 0;
`;
